			dangerMode: true
		}).then((willDelete) => {
			if (willDelete) {
				$.ajax({
					type: ""DELETE"",
					url: ""/Ventas/delete/"" + id,
					success: function(data) {
						if (data.success) {
							toastr.success(data.message);
							$(""#Ventas_"" + id).remove();
						}
						else {
							toastr.error(data.message);
						}
					}
				});
			}
		});
	}

